import React, { Component } from 'react';

const Test = () => {
  const username = useSelector(state=> state.user.username)
  const dispatch = useDispatch();

  dispatch({
    type: "updateUsername"
  })
  return ( 
    <div>{username}</div>
   );
}
 
export default Test
